window.bookSummaryJSON = "<p><b><i>North of Havana</i></b><b> by Randy Wayne White is now available for the first time in audio!</b> </p> <p>\"We'll drop anything we're doing to read a new Randy White novel and be glad we did.\" <i>(Denver Post</i>) </p> <p>Randy Wayne White's Doc Ford novels have been praised as \"witty\" (<i>San Diego Union-Tribune</i>), \"must-reads\" (<i>Chicago Tribune</i>) and \"superb\" (<i>Denver Post</i>). In his fifth Doc Ford novel, White takes Doc Ford to Havana, where his friend is being held by the Cuban government. Still haunted by his suspected involvement in a plot against Castro, Ford ventures to Cuba - where he finds himself entangled in a web of murder, revenge, and assassination.</p>"; 
